<p>المعلومات الشخصية التي تقدمها<br />
إذا كنت ترغب في استخدام خدمتنا ، يجب عليك إنشاء حساب على موقعنا. لإنشاء حسابك ، سنطلب معلومات التعريف الشخصية التي يمكن استخدامها للاتصال بك أو التعرف عليك ، والتي قد تتضمن اسمك ورقم هاتفك وعنوان بريدك الإلكتروني. قد نجمع أيضًا معلومات ديموغرافية عنك ، مثل الرمز البريدي الخاص بك ، ونسمح لك بإرسال معلومات إضافية ستكون جزءًا من ملفك الشخصي. بخلاف المعلومات الأساسية التي نحتاجها لإنشاء حسابك ، سيكون الأمر متروكًا لك لتحديد مقدار المعلومات التي تريد مشاركتها كجزء من ملفك الشخصي. نشجعك على التفكير مليًا في المعلومات التي تشاركها وننصحك بحماية هويتك ومعلوماتك الحساسة. بالطبع ، يمكنك مراجعة ومراجعة ملفك الشخصي في أي وقت.</p>

