ملفات تعريف الارتباط هي ملفات نصية صغيرة يتم وضعها على جهاز الكمبيوتر الخاص بك عن طريق مواقع الويب التي تزورها. يتم استخدامها على نطاق واسع من أجل جعل مواقع الويب تعمل ، أو تعمل بشكل أكثر كفاءة ، وكذلك لتوفير المعلومات لأصحاب الموقع. كما هو شائع على مواقع الويب ، قد نستخدم ملفات تعريف الارتباط والتكنولوجيا المماثلة لتتبع مستخدمينا والخدمات التي اختاروها. نحن نستخدم ملفات تعريف الارتباط &quot;للجلسة&quot; و &quot;الدائمة&quot;. يتم حذف ملفات تعريف الارتباط الخاصة بالجلسة بعد مغادرة موقعنا وعند إغلاق المستعرض الخاص بك. نحن نستخدم البيانات التي تم جمعها مع ملفات تعريف الارتباط للجلسة لتمكين ميزات معينة على موقعنا ، ولمساعدتنا على فهم كيفية تفاعل المستخدمين مع موقعنا ، وللمراقبة على مستوى إجمالي استخدام الموقع وتوجيه حركة مرور الويب. قد نسمح لشركاء الأعمال الذين يقدمون خدمات إلى موقعنا بوضع ملفات تعريف الارتباط على جهاز الكمبيوتر الخاص بك والتي تساعدنا في تحليل بيانات الاستخدام. لا نسمح لشركاء العمل هؤلاء بجمع معلوماتك الشخصية من موقعنا الإلكتروني باستثناء ما قد يكون ضروريًا للخدمات التي يقدمونها.</p>

