قد نستخدم جهات خارجية ، مثل Google ، لعرض إعلانات حول موقعنا على الإنترنت عبر الإنترنت. قد تستخدم هذه الجهات الخارجية ملفات تعريف الارتباط لتحديد الإعلانات التي قد تكون ذات صلة باهتماماتك (على سبيل المثال ، بناءً على زيارتك الأخيرة لموقعنا على الويب) ، للحد من عدد المرات التي ترى فيها إعلانًا ، ولقياس فعالية الإعلانات .</p>

<p>تحليلات كوكل<br />
يجوز لنا أيضًا استخدام Google Analytics أو خدمة مماثلة لجمع معلومات إحصائية حول زوار هذا الموقع وكيفية استخدامهم للموقع. هذا ، أيضا ، يتم على أساس مجهول. لن نحاول ربط البيانات المجهولة ببيانات التعريف الشخصية الخاصة بك. إذا كنت ترغب في معرفة المزيد حول Google Analytics ، فيرجى النقر هنا.</p>',
