            405 => 
            array (
                'id' => 969,
                'translationable_type' => 'App\\Models\\DataSetting',
                'translationable_id' => 90,
                'locale' => 'ar',
                'key' => 'about_us',
                'value' => '<p>&nbsp;</p>

<p>مرحبًا بك في 6ammart، نظام التوصيل الذي يعمل بنمط العديد من البائعين ويتبع شركة 6amtech. نحن فخورون بأن نقدم لك خدمة التوصيل الموثوقة والفعالة التي تلبي احتياجاتك اليومية.في 6ammart، نسعى جاهدين لجعل تجربة التسوق عبر الإنترنت أكثر سهولة وملاءمة. نحن نعمل بشكل وثيق مع مجموعة واسعة من البائعين الموثوق بهم والمتخصصين في مختلف المجالات، مما يتيح لك الوصول إلى مجموعة كبيرة من المنتجات على منصة واحدة مريحة.توفر 6ammart مجموعة متنوعة من المنتجات، بدءًا من المواد الغذائية الطازجة والمنتجات الصحية، وصولاً إلى الملابس والإكسسوارات والأدوات المنزلية. يمكنك تصفح متجرنا الإلكتروني بسهولة واختيار المنتجات التي تحتاجها، ثم يقوم فريقنا المحترف بتوصيلها مباشرة إلى باب منزلك.نحن نضمن جودة المنتجات والخدمة العالية التي تلبي توقعاتك. فريقنا ملتزم بتوفير تجربة تسوق رائعة لكل عميل. نحن نعمل على تقديم خدمة سريعة ودقيقة، ونهتم بحماية خصوصيتك وأمان معلوماتك الشخصية.مهمتنا في 6ammart هي تبسيط عملية التسوق وتلبية احتياجاتك اليومية بأسلوب سلس وموثوق. نحن نسعى لأن نكون الخيار الأمثل لك ولجميع احتياجاتك منتجات متنوعة، توصيل سريع، جودة عالية، وخدمة عملاء ممتازة.</p>',
                'created_at' => NULL,
                'updated_at' => NULL,
            ),
            406 => 
            array (
                'id' => 970,
                'translationable_type' => 'App\\Models\\DataSetting',
                'translationable_id' => 33,
                'locale' => 'ar',
                'key' => 'refund_policy',
                'value' => '<p>سياسة استرداد الأموال لـ 6ammart، نظام التوصيل متعدد البائعين لشركة 6amtechيسعدنا في 6amtech أن نقدم لكم نظام التوصيل متعدد البائعين الخاص بنا، 6ammart، ونحرص على توفير تجربة مرضية لكل عميل. إذا واجهتكم أي مشكلة أو لم تكونوا راضين تمامًا عن الطلب الذي قمتم بتقديمه، فإليكم سياسة استرداد الأموال لدينا:1. الشروط العامة:<br />
- يمكن استرداد الأموال فقط للمبالغ المدفوعة بواسطة العميل عن طريق منصة 6ammart.<br />
- يجب إبلاغنا بطلب استرداد الأموال في غضون 7 أيام من تاريخ استلام الطلب.<br />
- يجب إعادة المنتجات غير المرغوب فيها في حالتها الأصلية، بما في ذلك العبوة والعلامات الأصلية، ويتحمل العميل تكاليف الشحن العائدة.<br />
- قد يُطلب من العميل تقديم إثبات الشراء الأصلي، مثل إيصال الدفع أو رقم الطلب، قبل معالجة طلب الاسترداد.2. السلع التالفة أو الخاطئة:<br />
- في حالة استلام سلعة تالفة أو خاطئة، يُرجى إبلاغنا فورًا بالمشكلة عن طريق الاتصال بفريق خدمة العملاء لدينا.<br />
- سنقوم بتقديم الدعم اللازم وترتيب إعادة السلعة التالفة أو الاستبدال بالسلعة الصحيحة بأسرع وقت ممكن، أو إرجاع المبلغ المدفوع في حالة عدم توفر سلعة بديلة.<br />
- في حالة إعادة المنتجات التالفة أو الخاطئة، سنغطي تكاليف الشحن العائدة.3. الإلغاء والاسترداد قبل التوصيل:<br />
- يمكن إلغاء</p>',
                'created_at' => NULL,
                'updated_at' => NULL,
            ),
            407 => 
            array (
                'id' => 971,
                'translationable_type' => 'App\\Models\\DataSetting',
                'translationable_id' => 88,
                'locale' => 'ar',
                'key' => 'cancellation_policy',
                'value' => '<p>نحن في 6amtech نقدر تفهمك وقد نفهم أن هناك أوقات قد تحتاج فيها إلى إلغاء طلبك الذي قمت بتقديمه على منصة 6ammart للتوصيل من متاجر متعددة. نحن نحاول جعل عملية إلغاء الطلب سهلة ومريحة قدر الإمكان لعملائنا الكرام.إليكم سياسة إلغاء الطلب لدينا:1. الإلغاء قبل تأكيد الطلب:<br />
   إذا قررت إلغاء طلبك قبل تأكيده من قبل البائع، فأنت مؤهل للقيام بذلك دون أي رسوم إضافية. يرجى العلم أنه في حال تمت الموافقة على الطلب من قبل البائع، لن يكون بإمكانك إلغاء الطلب وستتم معالجته وفقًا لشروط البائع.2. الإلغاء بعد تأكيد الطلب:<br />
   إذا قررت إلغاء الطلب بعد تأكيده من قبل البائع، فسنقوم بتطبيق رسوم إلغاء تعتمد على الوقت الذي تم إلغاء الطلب فيه وحالة التجهيز للطلب. يرجى العلم أنه قد يكون هناك تأخير في إلغاء الطلب في حالة بدء عملية التجهيز بالفعل، وقد يتم تطبيق رسوم إضافية.3. رسوم الإلغاء:<br />
   يتم تحديد رسوم الإلغاء استنادًا إلى القواعد التالية:<br />
   - إذا تم إلغاء الطلب قبل بدء عملية التجهيز، فلن يتم تطبيق أي رسوم إضافية.<br />
   - إذا تم إلغاء الطلب بعد بدء عملية التجهيز، فسيتم تطبيق رسوم إلغاء تعتمد على نسبة من قيمة الطلب الملغاة.<br />
   - يجب أن يكون لديك رصيد كافٍ في حسابك على منصة 6ammart لسداد</p>',
