                'translationable_id' => 89,
                'locale' => 'ar',
                'key' => 'shipping_policy',
                'value' => '<p>سياسة الشحن لـ 6ammartشكرًا لاختياركم خدمة التسوق والتوصيل متعددة البائعين لـ 6ammart. نحن نسعى جاهدين لتوفير تجربة تسوق مريحة وممتعة، وجزءًا من ذلك يتعلق بسياسة الشحن الخاصة بنا. يهدف هذا السياسة لتوضيح إجراءات الشحن والتسليم الخاصة بنا، وكذلك المعلومات المتعلقة بالتكاليف والمدة الزمنية المتوقعة لتوصيل الطلبات. يرجى قراءة هذا الوثيقة بعناية للتعرف على التفاصيل.1. التوصيل:<br />
نحن نسعى لتوفير خدمة توصيل سريعة وفعالة. سيتم توصيل الطلبات إلى عنوان التسليم الذي حددته أثناء عملية الشراء. يرجى التأكد من توفر عنوان التسليم الصحيح والكامل، بما في ذلك الرمز البريدي، حيث أن أي بيانات غير صحيحة قد تؤدي إلى تأخير في التسليم.2. رسوم الشحن:<br />
سوف يتم تطبيق رسوم الشحن على الطلبات وفقًا للوزن والحجم والوجهة. سيتم عرض تكلفة الشحن الإجمالية عند إتمام عملية الشراء، ويجب على العميل دفع هذه الرسوم بالإضافة إلى سعر المنتجات المختارة.3. مدة التسليم:<br />
سنعمل على توصيل الطلبات في أقرب وقت ممكن، وسيتم تحديد مدة التسليم المتوقعة بناءً على وجهتك ووقت تقديم الطلب. يرجى ملاحظة أنه قد تحدث تأخيرات في حالات الظروف القاهرة أو الأحوال الجوية السيئة أو أي ظروف غير قابلة للتحكم.4. تتبع الطلب:<br />
نحن نقدم خدمة</p>',
