يرجى التأكد من حفظ المتعلقات الثمينة في مكان آمن.

يجب على العميل توفير الماء والكهرباء لدعم فني الخدمة.

قد يتغير سعر الخدمة إذا كانت منطقة العمل في حالة سيئة للغاية.

في حال زيادة مساحة العمل، يُضاف سعر إضافي.

يرجى التأكد من عدم وجود أي أعمال أخرى جارية أثناء تسليم خدمة التنظيف.',
